import * as apiCalls from '../api/apiCalls';

export const loginSuccess = (loginUserData) => {
  return {
    type: 'login-success',
    payload: loginUserData,
  };
};

export const loginHandler = (credentials) => {
  return apiCalls.login(credentials);
};
